import React from 'react';
import s from './Users.module.css';

const Users = (props) => {
    return (
        <div>
            {
                props.users.map( users => <div key={users.id} >
                        <span></span>
                        <span></span>
                </div>
                )
            }
        </div>

    )
}

export default Users;
